--  DDL for Package Body PKG_COMBOS
--------------------------------------------------------

  CREATE OR REPLACE PACKAGE BODY "SERVIEXPRESS"."PKG_COMBOS" IS

    PROCEDURE get_combo_tipo_usuario (
        data OUT cur
    )
        IS
    BEGIN
        OPEN data FOR SELECT
            a.id AS code,
            a.nombre AS name
                      FROM
            tipo_usuario a;

    END get_combo_tipo_usuario;

    PROCEDURE get_combo_pais (
        buscar_por_id       IN NUMBER,
        buscar_por_nombre   IN VARCHAR2,
        data                OUT cur
    )
        IS
    BEGIN
        OPEN data FOR SELECT
            a.id AS code,
            a.nombre AS name
                      FROM
            pais a
                      WHERE
            (
                a.id = buscar_por_id
                OR    buscar_por_id IS NULL
            )
            AND   (
                a.nombre = buscar_por_nombre
                OR    buscar_por_nombre IS NULL
            )
        ORDER BY
            a.id;

    END get_combo_pais;

    PROCEDURE get_combo_region (
        buscar_por_id       IN NUMBER,
        buscar_por_nombre   IN VARCHAR2,
        data                OUT cur
    )
        IS
    BEGIN
        OPEN data FOR SELECT
            a.id AS code,
            a.nombre AS name
                      FROM
            region a
                      WHERE
            a.pais_id = buscar_por_id
            AND   (
                a.nombre = buscar_por_nombre
                OR    buscar_por_nombre IS NULL
            )
        ORDER BY
            a.id;

    END get_combo_region;

    PROCEDURE get_combo_provincia (
        buscar_por_id       IN NUMBER,
        buscar_por_nombre   IN VARCHAR2,
        data                OUT cur
    )
        IS
    BEGIN
        OPEN data FOR SELECT
            a.id AS code,
            a.nombre AS name
                      FROM
            provincia a
                      WHERE
            a.region_id = buscar_por_id
            AND   (
                a.nombre = buscar_por_nombre
                OR    buscar_por_nombre IS NULL
            )
        ORDER BY
            a.id;

    END get_combo_provincia;

    PROCEDURE get_combo_comuna (
        buscar_por_id       IN NUMBER,
        buscar_por_nombre   IN VARCHAR2,
        data                OUT cur
    )
        IS
    BEGIN
        OPEN data FOR SELECT
            a.id AS code,
            a.nombre AS name
                      FROM
            comuna a
                      WHERE
            a.provincia_id = buscar_por_id
            AND   (
                a.nombre = buscar_por_nombre
                OR    buscar_por_nombre IS NULL
            )
        ORDER BY
            a.id;

    END get_combo_comuna;

    PROCEDURE get_combo_marca (
        buscar_por_id       IN NUMBER,
        buscar_por_nombre   IN VARCHAR2,
        data                OUT cur
    )
        IS
